	gps = BKE_gpencil_add_stroke(frameLines, color_Black, 353, 3);
	BKE_gpencil_stroke_add_points(gps, data21, 353, mat);

	gps = BKE_gpencil_add_stroke(frameLines, color_Black, 309, 3);
